import React from "react";

function Question(props)
{
	return (
			<div className="card">
				<h3>{ props.q.question_text }</h3>
				<div className="cardButtons">
					/* name=id that way e.target.name gets the id right away */
					<button name={ props.q.id } onClick={ props.onEdit } className="button edit">edit</button>
					<button onClick={ props.onDelete } className="button delete">delete</button>
				</div>
			</div>
	);
}

export default Question;
